import React, { useState } from "react";
import "./payment.css";
import firstPay from "../../images/first-pay.png"; // Visa
import secondPay from "../../images/second-pay.png"; // PayPal
import thirdPay from "../../images/third-pay.png"; // MasterCard
import fourthPay from "../../images/fourth-pay.png"; // Apple Pay
import StripeCheckout from 'react-stripe-checkout';
import axios from "axios";

function Payment() {
  // State to track selected payment method
  const [selectedMethod, setSelectedMethod] = useState(null);

  // Array of payment methods
  const paymentMethods = [
    { id: 1, name: "Visa", img: firstPay, lastFour: "2109" },
    { id: 2, name: "PayPal", img: secondPay, lastFour: "2109" },
    { id: 3, name: "MasterCard", img: thirdPay, lastFour: "2109" },
    { id: 4, name: "Apple Pay", img: fourthPay, lastFour: "2109" },
  ];

  // Handle payment method selection
  const handleMethodSelect = (id) => {
    setSelectedMethod(id);
  };

  // Payment process handler for Stripe
  const handleToProceedCheckout = async (token) => {
    try {
      const response = await axios.post(
        'http://44.196.192.232:3129/api/payment/create-payment-intent',
        {
          provider: 'stripe',
          amount: 100, 
          currency: 'auto',
          token: token.id, 
        }
      );
      console.log(response?.data?.data);  
    } catch (error) {
      console.log("Error during payment process:", error);
    }
  };

  // Dynamic button rendering based on selected method
  const renderPaymentButton = () => {
    const selectedPayment = paymentMethods.find(method => method.id === selectedMethod);
    
    if (!selectedPayment) return <button disabled>Select a Payment Method</button>;

    switch (selectedPayment.name) {
      case "Visa":
        return (
          <StripeCheckout
            name="MILLYS HB"
            image="http://localhost:3000/static/media/logo.22c2717f079a705976f8.png"
            amount={1000000} 
            currency="USD" 
            stripeKey="pk_test_51PqTR903ec58RCFWng6UUUnIZ8R0PmQZL1xVE5Wv6jUIAiS9dxzWobfK6oysU86LJmkvd9I2Adcbbv0jYqLkNcAp00hFGx4UKj"
            locale="IN"
            shippingAddress
            billingAddress={false}
            zipCode={false}
            token={handleToProceedCheckout}
          >
            <button>Pay with Visa (Stripe)</button>
          </StripeCheckout>
        );
      case "PayPal":
        return <button onClick={() => alert("Paying with PayPal")}>Pay with PayPal</button>;
      case "MasterCard":
        return <button onClick={() => alert("Paying with MasterCard")}>Pay with MasterCard</button>;
      case "Apple Pay":
        return <button onClick={() => alert("Paying with Apple Pay")}>Pay with Apple Pay</button>;
      default:
        return <button disabled>Select a Payment Method</button>;
    }
  };

  return (
    <div className="payment">
      <div className="payment-container">
        <div className="payment-banner">
          <h1>Payment</h1>
        </div>

        <div className="pay-methods container">
          <div className="payment-methods">
            <h2 style={{ color: "black", fontWeight: "500" }}>Payment</h2>

            {paymentMethods.map((method) => (
              <div
                key={method.id}
                className={`payment-option ${selectedMethod === method.id ? 'selected' : ''}`}
                onClick={() => handleMethodSelect(method.id)}
              >
                <img src={method.img} alt={method.name} />
                <span>************{method.lastFour}</span>
              </div>
            ))}
          </div>

          <div className="payment-summary">
            <div className="orders-summary">
              <div className="order-item">
                <span>Order</span>
                <span>₹ 7,000</span>
              </div>
              <div className="order-item">
                <span>Shipping</span>
                <span>₹ 30</span>
              </div>
              <div className="order-item">
                <span>Total</span>
                <span>₹ 7,030</span>
              </div>
            </div>

            <div className="payment-buttons">
              {renderPaymentButton()}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Payment;
